import React from 'react'

const TodoItem = (props) => {
    
    return (
        <div>
            <li>
                <input type="checkbox" />
                <strong>{props.id}</strong>
                {props.name}
                <button>&times;</button>
            </li>
        </div>
    )
}
export default TodoItem;
